import React from 'react';
import Comment from './Comment';


function CommentList({comments}) {
  return (
      <div>
          {comments.length && comments.map(comment => {
              return (
                  <Comment key={comment.id} comment={comment} />
              )
          })}
      </div>
  );
}

export default CommentList;
